import React, { useState } from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

export default function BookTicket(props) {
  const [mobileNumber, setMobileNumber] = useState('');
  const [fullName, setFullName] = useState('');
  const [DOB, setDOB] = useState('');
  const [Gender, setGender] = useState('');
  const [nationality, setNationality] = useState('');
  const [maritalStatus, setMaritalStatus] = useState('');
  const [selectedFile, setSelectedFile] = useState(null);
  const [passportNumber, setPassportNumber] = useState('');
  const [pIssueDate, setPIssueDate] = useState('');
  const [pExpiredDate, setPExpiredDate] = useState('');
  const [VisaDays, setVisaDays] = useState('');
  const [intArrivalDate, setIntArrivalDate] = useState('');
  const [selectedSeats, setSelectedSeats] = useState([]);

  const handleGenderChange = (event) => setGender(event.target.value);
  const handleVisaDaysChange = (event) => setVisaDays(event.target.value);
  const handleMaritalStatusChange = (event) => setMaritalStatus(event.target.value);
  const handleFileChange = (event) => setSelectedFile(event.target.files[0]);

  const handleSubmit = async (event) => {
    event.preventDefault();

    const bookingId = Math.floor(Math.random() * 1000000);

    // ðŸ‘‡ Create form data
    const formData = new FormData();
    formData.append('mobileNumber', mobileNumber);
    formData.append('fullName', fullName);
    formData.append('DOB', DOB);
    formData.append('Gender', Gender);
    formData.append('nationality', nationality);
    formData.append('maritalStatus', maritalStatus);
    formData.append('passportNumber', passportNumber);
    formData.append('pIssueDate', pIssueDate);
    formData.append('pExpiredDate', pExpiredDate);
    formData.append('VisaDays', VisaDays);
    formData.append('intArrivalDate', intArrivalDate);
    formData.append('passportPhoto', selectedFile);

    // ðŸ‘‰ Simulate upload
    console.log('FormData submitted (preview only):');
    for (let pair of formData.entries()) {
      console.log(`${pair[0]}: ${pair[1]}`);
    }

    // If using backend, uncomment below and use axios or fetch
    // await axios.post('/api/upload', formData)

    props.setData([
      ...props.data,
      {
        id: props.data.length + 1,
        mobileNumber,
        fullName,
        DOB,
        Gender,
        nationality,
        maritalStatus,
        passportNumber,
        pIssueDate,
        pExpiredDate,
        VisaDays,
        intArrivalDate,
        selectedSeats
      }
    ]);

    alert(`Booking ID: ${bookingId}\nFull Name: ${fullName}\nUploaded File: ${selectedFile?.name}`);
  };

  return (
    <form onSubmit={handleSubmit} className="book-ticket-form" encType="multipart/form-data">
      <h2>Apply Visa</h2>

      <div className="form-group mt-4">
        <b>Personal Information</b>
        <label>Full Name (as per passport):</label>
        <input type="text" value={fullName} onChange={(e) => setFullName(e.target.value)} required />

        <label>Mobile Number:</label>
        <input type="tel" value={mobileNumber} onChange={(e) => setMobileNumber(e.target.value)} required />

        <label>DOB:</label>
        <input type="date" value={DOB} onChange={(e) => setDOB(e.target.value)} required />

        <label>Gender:</label>
        <div style={{ marginLeft: '2em' }}>
          <label><input type="radio" value="male" checked={Gender === 'male'} onChange={handleGenderChange} /> Male</label>
          <label><input type="radio" value="female" checked={Gender === 'female'} onChange={handleGenderChange} /> Female</label>
          <label><input type="radio" value="other" checked={Gender === 'other'} onChange={handleGenderChange} /> Other</label>
        </div>

        <label>Nationality:</label>
        <input type="text" value={nationality} onChange={(e) => setNationality(e.target.value)} required />

        <label>Marital Status:</label>
        <select className="form-select" value={maritalStatus} onChange={handleMaritalStatusChange} required>
          <option value="">Select</option>
          <option value="Single">Single</option>
          <option value="Married">Married</option>
        </select>

        <label>Upload Passport Size Photo:</label>
        <input type="file" accept=".jpg,.jpeg,.png,.pdf" onChange={handleFileChange} required />
      </div>

      <div className="form-group mt-4">
        <b>Passport Details</b>
        <label>Passport Number:</label>
        <input type="text" value={passportNumber} onChange={(e) => setPassportNumber(e.target.value)} required />

        <label>Passport Issued Date:</label>
        <input type="date" value={pIssueDate} onChange={(e) => setPIssueDate(e.target.value)} required />

        <label>Passport Expired Date:</label>
        <input type="date" value={pExpiredDate} onChange={(e) => setPExpiredDate(e.target.value)} required />
      </div>

      <div className="form-group mt-4">
        <b>Travel Information</b>
        <label>Visa Required Days:</label>
        <select className="form-select" value={VisaDays} onChange={handleVisaDaysChange} required>
          <option value="">Select</option>
          <option value="30">30</option>
        </select>

        <label>Intended Arrival Date:</label>
        <input type="date" value={intArrivalDate} onChange={(e) => setIntArrivalDate(e.target.value)} required />
      </div>

      <button type="submit" className="btn btn-primary mt-3">Apply For Visa</button>
    </form>
  );
}
